import styled from 'styled-components';
import color from './Colors.js'

export default styled.div`
	padding-right: 15px;
  	padding-left: 15px;
  	margin-right: auto;
  	margin-left: auto;
  	background-color: ${color};
  	height: 50vh;


  	@media (min-width: 768px) {
    	width: 750px;
	}
	@media (min-width: 992px) {
	    width: 970px;
	}
	@media (min-width: 1200px) {
	    width: 1170px;
	}
`;
